:root {
    --theme-text-color: #64656a;
}

html {
    box-sizing: border-box;
}

*,
*::before,
*::after {
    box-sizing: border-box;
}

html,
body {
    height: 100%;
}

a {
    text-decoration: none;
    color: inherit;

    &:hover {
        color: inherit;
    }
}

button:focus,
input:focus {
    outline: transparent;
}


ul,
ol,
li,
p,
h1,
h2,
h3,
h4,
h5,
h6 {
    margin: 0;
    padding: 0;
}

body {
    margin: 0;
    padding: 0;
    position: relative;
    overflow-x: hidden;
    min-width: 320px;
    max-width: 100vw;
    cursor: default;
    font-family: "Loew", sans-serif;
    font-weight: 400;
    line-height: 140%;
    padding-top: 75px;
    
}

button {
    outline: none;
    padding: 0;
    background: transparent;
    border: none;
}

.containersect {
    padding-right: 75px;
    padding-left: 75px;
    width: 100%;
}

.text-center {
    text-align: center;
}

.text-end {
    text-align: right;
}

.gnrbtn {
    height: 38px;
    width: 190px;
    display: inline-flex;
    align-items: center;
    justify-content: center;
    text-transform: uppercase;
    color: #64656a;
    border: 1px solid #64656a;
    font-family: 'Loew';
    font-weight: 600;
    font-size: 12px;
    cursor: pointer;
    letter-spacing: 1px;
    transition: 0.5s;

    &:hover {
        background: #64656a;
        color: #fff;
    }
}

a {
    -webkit-tap-highlight-color: rgba(255, 255, 255, 0);
-webkit-tap-highlight-color: transparent;
}
